import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <p>{`Here you can import custom Case Counts data to display alongside the results of the simulation. Case counts are
displayed as dots on the trajectories plot. This allows to compare the results of the model with real-world statistics.`}</p>
    <p>{`The uploaded files are expected in CSV (comma-separated values) or TSV (tab-separated values) format. You can check out
some concrete examples of case counts files in our data directory, for example:
`}<a parentName="p" {...{
        "href": "https://github.com/neherlab/covid19_scenarios/blob/release/data/case-counts/unitedstates/USA-New%20York.tsv"
      }}>{`USA-New York.tsv`}</a></p>
    <p>{`After internal conversion, each row will be validated according to this JSON schema:
`}<a parentName="p" {...{
        "href": "https://github.com/neherlab/covid19_scenarios/blob/release/schemas/CaseCountsDatum.yml"
      }}>{`CaseCountsDatum.yml`}</a>{`.`}</p>
    <p>{`You can omit the missing values. But don't forget to put the appropriate number of columns (with consecutive tabs or commas).`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
